import React from "react";
import Header from "./Header/Header";
import Introduction from "./Introduction/Introduction";
import AboutMe from "./AboutMe/AboutMe";

import "./App.module.css";

function App() {
  return (
    <div>
      <Header />
      <Introduction />
      <AboutMe />
    </div>
  );
}

export default App;
